import React from 'react';
import { createRoot } from 'react-dom/client'; // ✅ use createRoot, not ReactDOM.render
import createStore from './reducks/store/store';

import './index.css';
import App from './App';
import { Provider } from 'react-redux';
import { BrowserRouter } from 'react-router-dom';
import reportWebVitals from './reportWebVitals';

// ⬇️ If you need history, import and use it correctly
// import * as History from 'history';
// const history = History.createBrowserHistory();

export const store = createStore(); // Assuming your store doesn't require history anymore

const container = document.getElementById('root');
const root = createRoot(container);

root.render(
  <Provider store={store}>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </Provider>
);

reportWebVitals();
